import React from "react";
function Summary(){
    return (
<div className="container">
    <div className="well">
        <h2>We have 4 clusters of customers:</h2>
        <ul className="unstyled">
            <li><strong>Cluster 1:</strong> Customers in this cluster have low cash advance and low one-off purchases</li>
            
            <li><strong>Cluster 2:</strong> Customers in this cluster have moderate cash advance and high one-off purchases</li>
            
            <li><strong>Cluster 3:</strong> Customers in this cluster have high cash advance and low one-off purchases</li>
            
            <li><strong>Cluster 4:</strong> Customers in this cluster have low cash advance and moderate one-off purchases</li>
        </ul>
    </div>
</div>

    
    )
}
export default Summary;
